import Navbar  from "../components/Navbar";
import ShopFilter from "./ShopFilter";
import ShopItem from "./ShopItem"


export default function ShopLayout(name){

    console.log(name)
    return (
        <div className="shop-layout">
            <div>
                {name['name']}
            </div>
            <ShopFilter />
            <div className="catalogue-container">
                <ShopItem />
            </div>
        </div>
    )
}
